import React, { useState, useEffect } from 'react';
import { Container, Typography, Box } from '@mui/material';
import { styled } from '@mui/system';

const AnimatedHello = styled('div')({
  position: 'relative',
  height: '100px',
  overflow: 'hidden',
  '@keyframes emergeAndRotate': {
    '0%': { top: '-50px', transform: 'rotate(180deg)' },
    '100%': { top: '0px', transform: 'rotate(0deg)' }
  },
  '& .hello': {
    position: 'absolute',
    animation: 'emergeAndRotate 2s forwards',
  }
});

const AnimatedName = styled('span')({
  '@keyframes slideIn': {
    '0%': { right: '-200px', opacity: 0 },
    '100%': { right: '0px', opacity: 1 }
  },
  position: 'relative',
  animation: 'slideIn 2s forwards',
  animationDelay: '2s',
  opacity: 0,
});

function Home() {
  const [showName, setShowName] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => setShowName(true), 2000);
    return () => clearTimeout(timer);
  }, []);

  return (
    <Container>
      <Box my={4}>
        <AnimatedHello>
          <Typography variant="h2" component="h1" className="hello">
            Hello,
          </Typography>
        </AnimatedHello>
        <Typography variant="h2" component="h1" gutterBottom>
          {showName && <AnimatedName>I'm [Your Name]</AnimatedName>}
        </Typography>
        <Typography variant="h5" component="h2" gutterBottom>
          A [Your Profession] passionate about creating amazing web experiences.
        </Typography>
      </Box>
    </Container>
  );
}

export default Home;
